import React from "react";

export default class EntityField extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="entity-field" key={this.props.field.htmlId}>
        <td>
          <span id="field-label-status-{{this.props.field.htmlId}}">
            {this.props.field.label}
          </span>
        </td>
        <td>{
            this.props.field.type === 'select' ? <EntityField_Select field={this.props.field} /> : <EntityField_Common field={this.props.field} />
        }</td>
        <div id="field-css-status-htmliD>" />
      </div>
    );
  }
}

class EntityField_Select extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <select id="<?php echo $field->htmlId; ?>">
                <option value="f">Select</option>
                <option value="dd">Front Balcony</option>
                <option value="dd">Front Hdff</option>
            </select>
        );
    }
}

class EntityField_Common extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <input
                id={this.props.field.htmlId}
                type={this.props.field.type}
                value={this.props.field.value}
                placeholder={this.props.field.placeholder}
            />
            );
    }
}
